description_s:
At least 2 capture loss notices higher than 30% have been seen across 24 hours, across all deployed vSensors. The capture loss indicates the percentage of ACKs seen where the data being ACKed was not seen. Sustained capture loss at or above this level will significantly impact Darktrace detections. This model indicates the packet loss is occurring before Darktrace ingestion rather than a problem with the vSensor.

Action: Investigate whether this is caused by one vSensor or whether multiple vSensors have contributed to the model breach. The query below can be used in Advanced Search to filter for vSensor capture loss notices greater than 30% :
@fields.note:"CaptureLoss::Too_Much_Loss" AND @fields.size:>29 AND NOT @fields.msg:*dt*
